        private void LIRAMappingWrapper(String LIRA_attribute_value, FuseValue Local_Fuse, Dictionary<string, string> myDictionary)
        {
            Console.WriteLine("Applying LIRA mapping for " + Local_Fuse.FuseName);
            Local_Fuse.FuseSetValue = myDictionary[LIRA_attribute_value];
        }
        private void LIRAMappingWrapper(Double LIRA_attribute_value, FuseValue Local_Fuse, Dictionary<string, string> myDictionary)
        {
            Console.WriteLine("Applying LIRA mapping for " + Local_Fuse.FuseName);
            Local_Fuse.FuseSetValue = myDictionary[LIRA_attribute_value.ToString()];
        }
        private string dec2hex(double DoubleValue)
        {
            int IntValue = Convert.ToInt32(Math.Floor(DoubleValue));
            return "1'h" + IntValue.ToString("X");
        }
        private string dec2hex(int IntValue)
        {
            return "1'h" + IntValue.ToString("X");
        }
        private string ASCII_Convertor_in_binary(String input_string, int per_input_char_binary_padding)
        {
            byte[] bytes = Encoding.ASCII.GetBytes(input_string);
            string result = "";
            foreach (int i in bytes)
            {
                result = result + Convert.ToString(i, 2).PadLeft(per_input_char_binary_padding, '0');
            }
            return result;
        }
        private string HexConverted(string strBinary)
        {
            string strHex = Convert.ToInt32(strBinary, 2).ToString("X");
            return "1'h" + strHex;
        }
        private static string LIRAFuseValue(String LIRA_attribute_value, FuseInfo Local_Fuse, Dictionary<string, string> myDictionary)
        {
            Console.WriteLine("Applying LIRA mapping for " + Local_Fuse.FuseName);
            Local_Fuse.FuseSetValue = myDictionary[LIRA_attribute_value];
            return Local_Fuse.FuseSetValue;
        }
        private static string LIRAFuseValue(Double LIRA_attribute_value, FuseValue Local_Fuse, Dictionary<string, string> myDictionary)
        {
            Console.WriteLine("Applying LIRA mapping for " + Local_Fuse.FuseName);
            Local_Fuse.FuseSetValue = myDictionary[LIRA_attribute_value.ToString()];
            return Local_Fuse.FuseSetValue;
        }



