        internal void Call_Fusing_C(LineItem lineItem)
        {
            if (lineItem.QDF_SSPEC.Value != "TEST") // Regular Fuse File Generation (FORT Push/ Config SetPoint), For Fuse file System generation also.
            //if (lineItem.QDF_SSPEC.Value != "Q324" && lineItem.QDF_SSPEC.Value != "Q2UZ" || lineItem.QDF_SSPEC.Value != "Q46P" || lineItem.QDF_SSPEC.Value != "Q43Y" || lineItem.QDF_SSPEC.Value != "Q7NX" || lineItem.QDF_SSPEC.Value != "Q4UK" || lineItem.QDF_SSPEC.Value != "Q7LA" || lineItem.QDF_SSPEC.Value != "Q7SX" || lineItem.QDF_SSPEC.Value != "Q7YS") //Enable for FuseNow generation
            {
                Direct_Fuses_FusingOnly(lineItem);
                Direct_Skip_Fuses(lineItem); //Comment out this line while generating the FuseNow to make sure No SKIP fuses are reported in the FuseNow string.
                EquationOverride_FusingOnly(lineItem);
            }
        }
