        internal void Dynamic_Fuses_CDIE_DF(LineItem lineItem)
        {
            string fusing_recipe = "0";

            if ((GNR_Dynamic.PackageName == "X1" || GNR_Dynamic.PackageName == "X2" || GNR_Dynamic.PackageName == "X3" || GNR_Dynamic.PackageName == "HCC") && lineItem.QDF_SSPEC.Value != "TEST")
            //if ((GNR_Dynamic.PackageName == "X1" || GNR_Dynamic.PackageName == "X2" || GNR_Dynamic.PackageName == "X3" || GNR_Dynamic.PackageName == "HCC" || GNR_Dynamic.PackageName == "XCC_Plus") && lineItem.QDF_SSPEC.Value != "TEST") //disabling XCC_Plus pkg from being dynamic
            {
                    fusing_recipe = "1"; // Set to "0" for DRV

            }
            
